import "./styles.css";
import ScheduleSelector from "react-schedule-selector";
import * as React from "react";

export default function App() {
  const [schedule, setSchedule] = React.useState([]);
  const startDate = new Date("2022-09-23T14:27:01.444Z");
  return (
    <ScheduleSelector
      selection={schedule}
      numDays={5}
      startDate={startDate}
      dateFormat="dddd"
      minTime={8}
      maxTime={22}
      hourlyChunks={4}
      timeFormat={'h:mma'}
      onChange={setSchedule}
    />
  );
}
